import React from 'react';
import ReactDOM from 'react-dom';
import Coverflow from 'react-coverflow';
import { StyleRoot } from 'radium';

import NSA from "../../pages/images/nsaBuild.jpg";
import doctor from "../../pages/images/doctor.jpg";
import trivia from "../../pages/images/triviaChuck.jpg";
import biohazzard from "../../pages/images/biohazzard.jpg";
import claws from "../../pages/images/claws.jpg";

function Slides2() {
return(
  <StyleRoot>
    <Coverflow
      displayQuantityOfSide={2}
      navigation
      infiniteScroll
      enableHeading
      media={{
        '@media (max-width: 900px)': {
          width: '600px',
          height: '300px'
        },
        '@media (min-width: 900px)': {
          width: '960px',
          height: '600px'
        }
      }}
    >
      <img src={NSA} alt='Album one' data-action="https://facebook.github.io/react/"/>
      <img src={claws} alt='Album two' data-action="http://passer.cc"/>
      <img src={doctor} alt='Album three' data-action="https://doce.cc/"/>
      <img src={trivia} alt='Album four' data-action="http://tw.yahoo.com"/>
    </Coverflow>
  </StyleRoot>
  ,
  document.querySelector('.example_2')
);
    }

export default Slides2;
